        private static bool seeded = false;
        public Configuration()
        {
            AutomaticMigrationsEnabled = true;
        }

        protected override void Seed(ESamplingDbContext context)
        {
            if (seeded)
                return;
            seeded = true;

            if (!context.LabelFormats.Any())
                SeedLabels(context);

            if (!context.Terminals.Any())
                SeedTerminalsAndPrinters(context);
        }

